import React from "react";

// This is the search bar component. Provide it specified class names for one
// of the two main styles. Either menu, or normal.
export class SearchBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = { value: this.props.placeholder };
    console.log("placeholder = " + this.props.placeholder);
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  handleChange(event) {
    console.log("current handlechange value: " + event.target.value);
    this.setState({ value: event.target.value });
  }

  handleSubmit(event) {
    console.log("Search Query: " + this.state.value);
    event.preventDefault();
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit} className={this.props.name}>
        <img
          src="https://img.icons8.com/android/24/000000/search.png"
          className={this.props.imagename}
          alt="searchIcon"
        ></img>
        <input
          className={this.props.inputname}
          type="text"
          // placeholder={this.props.placeholder}
          onChange={this.handleChange}
        />
      </form>
    );
  }
}
